import React from 'react'
import './Sidebar.css'
import Category from './Category/Category'

function Sidebar() {
  return (
    <aside>
        <i class="bi bi-cart4 fa-lg"></i>
        <Category></Category>
    </aside>
  )
}

export default Sidebar
